import React from "react";
import { AppBar, IconButton, Toolbar } from "@mui/material";

export const MuiAppBar = () => {
  return (
    <AppBar position="static">
      <Toolbar>
        <IconButton>
          <>
            <img src="./src/images/logo512.png" alt="" />
          </>
        </IconButton>
      </Toolbar>
    </AppBar>
  );
};
